import React from 'react';
import { Link } from 'react-router-dom';
import './Portfolio.css';

// Import actual photos
import photo1 from '../Photos/DSC00390.jpg';
import photo2 from '../Photos/DSC04635.jpg';
import photo3 from '../Photos/DSC04724.jpg';
import photo4 from '../Photos/DSC04875.jpg';

const Portfolio = () => {
  const portfolioCategories = [
    {
      id: 'personal',
      title: 'Personal Photoshoot',
      description: 'Intimate portraits that capture your essence and personality',
      image: photo1,
      link: '/gallery?category=personal'
    },
    {
      id: 'fashion',
      title: 'Fashion/Beauty Campaigns',
      description: 'Visual campaigns for niche brands. Includes photo and video content.',
      image: photo2,
      link: '/gallery?category=photo-fashion'
    },
    {
      id: 'weddings',
      title: 'Weddings',
      description: 'Timeless memories from your special day with elegance and artistry',
      image: photo3,
      link: '/gallery?category=weddings'
    }
  ];

  return (
    <div className="portfolio-page">
      <section className="portfolio-hero">
        <div className="portfolio-container">
          <h1 className="portfolio-title">PORTFOLIO</h1>
          <p className="portfolio-subtitle">Select a category to explore</p>
        </div>
      </section>

      <section className="portfolio-categories">
        <div className="portfolio-container">
          <div className="portfolio-grid">
            {portfolioCategories.map((category) => (
              <Link
                key={category.id}
                to={category.link}
                className="portfolio-card"
              >
                <div className="portfolio-card-image">
                  <img src={category.image} alt={category.title} />
                  <div className="portfolio-card-overlay">
                    <span className="portfolio-card-link">View Gallery</span>
                  </div>
                </div>
                <div className="portfolio-card-content">
                  <h2 className="portfolio-card-title">{category.title}</h2>
                  <p className="portfolio-card-description">{category.description}</p>
                </div>
              </Link>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default Portfolio;
